const Header = () => {
    return ( 
    <header className="header">
            <div className="header_logo">
                <img src={process.env.PUBLIC_URL + '/img/logo.png'} />
            </div>
            <nav className="nav">
                <ul className="nav-list">
                    <li>About</li>
                    <li>Team</li>
                    <li>Contact</li>
                </ul>
            </nav> 
        </header>

    );
}

export default Header;
